import React, { useEffect, useState } from 'react';
import { apiRequest } from '../utils/api';
import PostCard from '../components/PostCard';
import { MagnifyingGlassIcon } from '@heroicons/react/24/outline';

function Home() {
  const [posts, setPosts] = useState([]);
  const [search, setSearch] = useState('');
  const [page, setPage] = useState(1);
  const [total, setTotal] = useState(0);
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    setLoading(true);
    apiRequest(`/api/posts?search=${search}&page=${page}&limit=9`)
      .then(data => {
        setPosts(data.posts);
        setTotal(data.total);
      })
      .catch(() => setPosts([]))
      .finally(() => setLoading(false));
  }, [search, page]);

  return (
    <div className="min-h-screen bg-dots-pattern">
      <div className="container mx-auto px-4 py-12">
        <div className="max-w-2xl mx-auto mb-12">
          <h1 className="text-5xl font-bold text-gray-800 text-center mb-4 animate-fade-in">
            Discover Amazing Stories
          </h1>
          <p className="text-center text-gray-600 mb-8 animate-fade-in" style={{ animationDelay: '0.2s' }}>
            Explore the latest thoughts, ideas, and stories from our community
          </p>
          <div className="relative animate-slide-up" style={{ animationDelay: '0.4s' }}>
            <MagnifyingGlassIcon className="h-5 w-5 text-gray-400 absolute left-3 top-1/2 transform -translate-y-1/2" />
            <input
              type="text"
              placeholder="Search by title or author..."
              value={search}
              onChange={e => setSearch(e.target.value)}
              className="w-full pl-10 pr-4 py-3 glass-card rounded-lg focus:ring-2 focus:ring-primary-500 focus:border-transparent"
            />
          </div>
        </div>

        {loading ? (
          <div className="flex justify-center items-center min-h-[300px]">
            <div className="relative">
              <div className="animate-spin rounded-full h-12 w-12 border-t-2 border-b-2 border-primary-600"></div>
              <div className="animate-ping absolute inset-0 rounded-full bg-primary-400 opacity-20"></div>
            </div>
          </div>
        ) : posts.length === 0 ? (
          <div className="glass-card rounded-lg p-8 max-w-md mx-auto text-center animate-fade-in">
            <div className="text-gray-400 mb-4">
              <svg className="h-16 w-16 mx-auto" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={1.5} d="M21 21l-6-6m2-5a7 7 0 11-14 0 7 7 0 0114 0z" />
              </svg>
            </div>
            <p className="text-xl text-gray-600 mb-2">No posts found</p>
            <p className="text-gray-500">Try adjusting your search terms or browse all posts</p>
          </div>
        ) : (
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
            {posts.map((post, index) => (
              <div key={post._id} style={{ animationDelay: `${index * 0.1}s` }} className="animate-fade-in">
                <PostCard post={post} />
              </div>
            ))}
          </div>
        )}

        {total > 0 && (
          <div className="mt-12 text-center">
            <div className="inline-flex items-center justify-center space-x-4 glass-card px-6 py-3 rounded-lg">
              <button 
                disabled={page === 1} 
                onClick={() => setPage(page - 1)} 
                className={`btn-primary ${page === 1 ? 'opacity-50 cursor-not-allowed' : ''}`}
              >
                Previous
              </button>
              <span className="text-gray-600">Page {page}</span>
              <button 
                disabled={page * 9 >= total} 
                onClick={() => setPage(page + 1)} 
                className={`btn-primary ${page * 9 >= total ? 'opacity-50 cursor-not-allowed' : ''}`}
              >
                Next
              </button>
            </div>
            <p className="text-gray-600 mt-4">
              Showing {Math.min(page * 9, total)} of {total} posts
            </p>
          </div>
        )}
      </div>
    </div>
  );
}

export default Home;
